import React, { Component } from 'react'

class Contact extends Component {
    render() {
        const { name, email, phone } = this.props;
        return (

            <div>
                <h2>{this.props.name}</h2>
                <ul>
                    <li>Email : {this.props.email}</li>
                    <li>Phone : {this.props.phone}</li>
                </ul>
            </div>
        )
    }
}

export default Contact;
